/* Procedure structure for procedure `getgroupisread` */

/*!50003 DROP PROCEDURE IF EXISTS  `getgroupisread` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`maxdistrodb`@`%.%.%.%` PROCEDURE `getgroupisread`(IN UserId INT UNSIGNED)
BEGIN
	DECLARE count_single_msg, tot_group_msg, tot_group_msg_read, tot_unread_group_msg, tot_unread_msg INT UNSIGNED;
	
	SET count_single_msg = (SELECT
    COUNT(*)
FROM
    `safe_text_us`.`participants`
    INNER JOIN `safe_text_us`.`users` 
        ON (`participants`.`contact_id` = `users`.`id`)
    INNER JOIN `safe_text_us`.`messages` 
        ON (`participants`.`message_id` = `messages`.`id`)
WHERE (`participants`.`contact_id` =UserId) AND (`participants`.`is_sender` =0) AND (messages.is_read = 0));
	
	SET tot_group_msg = (SELECT
    COUNT(*)
FROM
    `safe_text_us`.`group_message`
    INNER JOIN `safe_text_us`.`messages` 
        ON (`group_message`.`message_id` = `messages`.`id`)
    INNER JOIN `safe_text_us`.`groups` 
        ON (`groups`.`id` = `group_message`.`group_id`)
WHERE (`group_message`.`sender_id` !=UserId) AND FIND_IN_SET(UserId,`groups`.`participants_id`) > 0);
	
	SET tot_group_msg_read = (SELECT
    COUNT(*)
FROM
    `safe_text_us`.`groups`
    INNER JOIN `safe_text_us`.`group_message` 
        ON (`groups`.`id` = `group_message`.`group_id`)
    INNER JOIN `safe_text_us`.`messages` 
        ON (`messages`.`id` = `group_message`.`message_id`)
    INNER JOIN `safe_text_us`.`group_message_isread` 
        ON (`group_message_isread`.`message_id` = `messages`.`id`)
WHERE (`group_message_isread`.`user_id` =UserId) AND FIND_IN_SET(UserId,`groups`.`participants_id`) >0);
	
	SET tot_unread_group_msg = tot_group_msg - tot_group_msg_read;
	
	SET tot_unread_msg = tot_unread_group_msg + count_single_msg;
	
	SELECT `tot_unread_msg` AS `tot_unread`;
	
    END */$$
DELIMITER ;

