/* Procedure structure for procedure `syncAddGroup` */

/*!50003 DROP PROCEDURE IF EXISTS  `syncAddGroup` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`maxdistrodb`@`%.%.%.%` PROCEDURE `syncAddGroup`(IN senderIdIn int unsigned, IN groupNameIn VARCHAR(64), IN groupIdIn VARCHAR(64), In participantsId VARCHAR(32),In participantsName VARCHAR(64))
BEGIN
