/* Procedure structure for procedure `syncGroupMessage` */

/*!50003 DROP PROCEDURE IF EXISTS  `syncGroupMessage` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`maxdistrodb`@`%.%.%.%` PROCEDURE `syncGroupMessage`(IN groupIdIn INT UNSIGNED, IN messageId INT UNSIGNED, IN isImportantIn TINYINT(1) UNSIGNED, IN isDraftIn TINYINT(1) UNSIGNED, IN isReadIn TINYINT(1) UNSIGNED, IN totreceipientsIn INT UNSIGNED, IN recipientIdIn VARCHAR(64), IN senderIdIn VARCHAR(64), IN senderNameIn VARCHAR(64))
BEGIN
	DECLARE deviceId, userId, senderId, recipientId INT UNSIGNED;
	DECLARE isImportant, isDraft, isRead TINYINT(1) UNSIGNED;
	DECLARE sendername1, sendername2, sendername VARCHAR(64);
	DECLARE readDate, sentDate, expireDate DATETIME;
	DECLARE msgContent TEXT;
	DECLARE tot_is_read INT UNSIGNED;
	DECLARE cur_is_read INT UNSIGNED;
	DECLARE msg_sender INT UNSIGNED;
	DECLARE msgImage VARCHAR(32);
	DECLARE done INT DEFAULT FALSE;
	DECLARE cur CURSOR FOR SELECT id, user_id FROM sync_device WHERE 1 AND FIND_IN_SET(`user_id`, recipientIdIn) > 0;
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
	/* Get the message's current values */
	SELECT content,image,is_important,is_draft,is_read,read_date,sent_date,expire_date
		INTO msgContent,msgImage,isImportant,isDraft,isRead,readDate,sentDate,expireDate
		FROM messages WHERE id=messageId;
	
	
	/* Determine what can be changed based on this user's role (sender/recipient) */
	
	/* if a message has been changed from draft to active, reset the expire date */
		IF isDraft = 1 AND isDraftIn = 0 THEN
			UPDATE messages SET expire_date = DATE_ADD(NOW(),INTERVAL 24 HOUR) WHERE id=messageId LIMIT 1;
		END IF;
		SET isImportant = isImportantIn;
		SET isDraft = isDraftIn;
		
		SET isRead = isReadIn;
		IF isRead = 1 AND readDate = '0000-00-00 00:00:00' THEN
			SET readDate=NOW();
		END IF;
	
	SET tot_is_read = (SELECT `count_is_read` FROM group_message WHERE `message_id` = messageId);
	SET cur_is_read = (SELECT `is_read` FROM messages WHERE `id` = messageId);
	/* Update the message */
	
	IF tot_is_read >= (totreceipientsIn-1) THEN
	UPDATE messages SET is_important=isImportant, is_draft=isDraft, is_read=isRead, read_date=readDate WHERE id=messageId LIMIT 1;
	END IF;
    
	IF tot_is_read >= (totreceipientsIn-1) THEN
	/* Delete any sync records queued for this message */
	IF cur_is_read = 0 THEN
	DELETE FROM sync_queue WHERE `pk`=messageId AND tablename='messages';
	/* Queue a pull record for every device */
	SET msgContent = REPLACE(msgContent, '\\', '\\\\'); /* JSON encoding for \ */
	SET msgContent = REPLACE(msgContent, '"', '\\"'); /* JSON encoding for " */
	SET msg_sender = (SELECT `sender_id` FROM group_message WHERE `message_id` = messageId);
	OPEN cur;
		read_loop: LOOP
			FETCH cur INTO deviceId, userId;			
			IF done THEN
				LEAVE read_loop;
			END IF;
			
			SET sendername1 = (SELECT `name` FROM `contacts` WHERE `contact_user_id` IN (senderIdIn) AND user_id=userId); 
			SET sendername2 = (SELECT `username` FROM `users` WHERE `id` IN (senderIdIn));
			
			IF sendername1 IS NOT NULL THEN
			SET sendername = sendername1;
			ELSE 
			SET sendername = sendername2;
			END IF;
			
				INSERT INTO sync_queue (id,user_id,device_id,date_added,tablename,pk,vals,is_pulled) VALUES (NULL,userId,deviceId,NOW(),'messages',messageId,CONCAT_WS('','{"sender":"',msg_sender,'","sender_name":"',sendername,'","group_id":"',groupIdIn,'","recipients":["',recipientIdIn,'"],"content":"',msgContent,'","image":"',msgImage,'","is_read":"',isRead,'","is_important":"',isImportant,'","is_draft":"',isDraft,'","sent_date":"',sentDate,'","read_date":"',readDate,'","expire_date":"',expireDate,'","is_updated":"0","is_deleted":"0"}'),0);
			
		END LOOP;
	CLOSE cur;
	
	END IF;
	END IF;
	
END */$$
DELIMITER ;

